import React, { useState } from 'react';
import './Nav.css';
import Nav from './Nav';

export default function NavBar() {
    const [pages, setPages] = useState([
        {
            page: 'About',
            url: '#about',
        },
        {
            page: 'Timeline',
            url: '#timeline',
        },
        {
            page: 'Projects',
            url: '#projects',
        },
        {
            page: 'Contact',
            url: '#contact',
        }
    ]);

    return (
        <div className="nav-bar">
            <ul className="pages-container">
                {pages.map(page => (
                    <Nav title={page.title} page={page.url} />
                ))}                 
            </ul>  
        </div>
    );
}
